export const UPDATE_QUERY_RESULT = "UPDATE_QUERY_RESULT";
export const UPDATE_DATA = "UPDATE_DATA";

const getInitialQuery = (results : any) => ({
    type: UPDATE_QUERY_RESULT,
    results
});

const updateData = (results: any) => ({
    type: UPDATE_DATA,
    results
});

export { getInitialQuery, updateData };
